// src/components/VendorRegistration.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Form, Button, Alert } from 'react-bootstrap';
import api from '../api/api';

const VendorRegistration = () => {
    const [vendorData, setVendorData] = useState({
        firstName: '',
        lastName: '',
        businessName: '',
        businessAddress: '',
        licenseNumber: '',
        phoneNumber: '',
        email: '',
        password: ''
    });
    const [error, setError] = useState('');
    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setVendorData({ ...vendorData, [name]: value });
    };

    const validateFields = () => {
        for (const key in vendorData) {
            if (!vendorData[key]) {
                setError(`Please enter your ${key}`);
                return false;
            }
        }
        setError('');
        return true;
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!validateFields()) return;

        try {
            const response = await api.post('/vendors/register', vendorData);
            if (response.data.success) {
                navigate('/');
            }
        } catch (error) {
            setError(error.response?.data?.message || 'An error occurred');
        }
    };

    return (
        <div className="container mt-5" style={{ maxWidth: '500px' }}>
            <h2 className="text-center">Vendor Registration</h2>

            {error && <Alert variant="danger">{error}</Alert>}

            <Form onSubmit={handleSubmit}>
                <Form.Group className="mb-3" controlId="firstName">
                    <Form.Label>First Name</Form.Label>
                    <Form.Control type="text" name="firstName" value={vendorData.firstName} onChange={handleChange} required />
                </Form.Group>

                <Form.Group className="mb-3" controlId="lastName">
                    <Form.Label>Last Name</Form.Label>
                    <Form.Control type="text" name="lastName" value={vendorData.lastName} onChange={handleChange} required />
                </Form.Group>

                <Form.Group className="mb-3" controlId="businessName">
                    <Form.Label>Business Name</Form.Label>
                    <Form.Control type="text" name="businessName" value={vendorData.businessName} onChange={handleChange} required />
                </Form.Group>

                <Form.Group className="mb-3" controlId="businessAddress">
                    <Form.Label>Business Address</Form.Label>
                    <Form.Control type="text" name="businessAddress" value={vendorData.businessAddress} onChange={handleChange} required />
                </Form.Group>

                <Form.Group className="mb-3" controlId="licenseNumber">
                    <Form.Label>License Number</Form.Label>
                    <Form.Control type="text" name="licenseNumber" value={vendorData.licenseNumber} onChange={handleChange} required />
                </Form.Group>

                <Form.Group className="mb-3" controlId="phoneNumber">
                    <Form.Label>Phone Number</Form.Label>
                    <Form.Control type="text" name="phoneNumber" value={vendorData.phoneNumber} onChange={handleChange} required />
                </Form.Group>

                <Form.Group className="mb-3" controlId="email">
                    <Form.Label>Email</Form.Label>
                    <Form.Control type="email" name="email" value={vendorData.email} onChange={handleChange} required />
                </Form.Group>

                <Form.Group className="mb-3" controlId="password">
                    <Form.Label>Password</Form.Label>
                    <Form.Control type="password" name="password" value={vendorData.password} onChange={handleChange} required />
                </Form.Group>

                <Button variant="primary" type="submit" className="w-100">Register</Button>
            </Form>

            <div className="text-center mt-3 mb-4">
                Already a member? <a href="/login">Sign in</a>
            </div>
        </div>
    );
};

export default VendorRegistration;
